import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, NavLink } from 'react-router-dom';
import './App.css'

function Navbar() {

    const [user, setUser] = useState(null);

    const navigate = useNavigate();

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/login');
        } else {
            axios.get('/api/auth/verify', { headers: { authorization: token } })
                .then(response => {
                    if (response.status !== 200) {
                        navigate('/login');
                    } else {
                        setUser(response.data.user); // Imposta l'utente
                    }
                })
                .catch((error) => {
                    console.error('Verification error:', error);
                    navigate('/login');
                });
        }
    }, [navigate]);

    if (!user) {
        return <div>Caricamento in corso...</div>
    }

    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-success fixed-top">
                <div className="container-fluid">
                    <a className="navbar-brand" href="/homepage">
                        <img src="/assets/img/logoNuovo.png" alt="" className="d-inline-block align-text-top" style={{ width: '50px', height: '50px' }} />
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <NavLink  to="/homepage" activeClassName="active" className="nav-link text-white">
                                    Home
                                </NavLink>
                            </li>
                            <li className="nav-item dropdown">
                                <NavLink  to="/categorie" activeClassName="active" className="nav-link dropdown-toggle text-white" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                    Categorie
                                </NavLink>
                                <ul className="dropdown-menu">
                                    <li><NavLink to="/categorie/cultura" className="dropdown-item">Cultura</NavLink></li>
                                    <li><NavLink to="/categorie/concerti" className="dropdown-item">Concerti</NavLink></li>
                                    <li><NavLink to="/categorie/mostre" className="dropdown-item">Mostre</NavLink></li>
                                    <li><NavLink to="/categorie/party" className="dropdown-item">Party</NavLink></li>
                                    <li><NavLink to="/categorie/sport" className="dropdown-item">Sport</NavLink></li>
                                </ul>
                            </li>
                            <li className="nav-item">
                                <NavLink  to="/mappa" activeClassName="active" className="nav-link text-white">
                                    Mappa
                                </NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink to="/chat" activeClassName="active" className="nav-link text-white">
                                    Chat
                                </NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink to="/profilo" activeClassName="active" className="nav-link text-white">
                                    Profilo
                                </NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink to="/organizzatore" activeClassName="active" className={`nav-link ${user.organizer ? 'text-white ' : 'disabled'}`} href={`${user.organizer ? '/organizzatore' : ''}`} aria-disabled={!user.organizer}>
                                    Organizzatore
                                </NavLink>
                            </li>
                        </ul>
                        <form className="d-flex" role="search">
                            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                            <button className="btn btn-outline-light me-2" type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </nav>


            <div className="m-5 p-2">
                <div></div>
            </div>

        </div>

    );
}

export default Navbar;
